import styled from 'styled-components';

export const Container = styled.div`
width:100px;
height:40px;
background:#a5aaad;
font-size:14px;
font-weight:600;
display:flex;
justify-content:center;
align-items:center;
outline:none;
border:1px solid #757575;
border-radius:3px;
color:#757575;

`
